function solution (num) {
    let answer = 0;
    let n = num.length;
    
    function BFS() {
        let check = Array.from({length: n + 1}, () => 0);
        let queue = [];
        queue.push([num[0], 0]);
        check[0] = 1;
        let L = 0;

        while(queue.length){
            let len = queue.length;
            for(let i = 0; i < len; i++) {
                let x = queue.shift();
                if (x[0] === 0 && x[1] !== n-1) continue;
                for (let j = x[1]; j <= x[0]; j++) {
                    let nx = [num[j], j];
                    if (nx[1] === n - 1) return L + 1;
                    if (check[nx[1]] === 0){
                        check[nx[1]] = 1;
                        queue.push(nx);
                        check[nx[1]] = 0;
                    }
                }
            }
            L++;
        }
    }

    answer = BFS();
    return answer;
}
